contracts/Vote.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

/**
 * @title Storage
 * @dev Store & retrieve value in a variable
 * @custom:dev-run-script ./scripts/deploy_with_ethers.ts
 */
contract Vote {

    uint256 voteFee;

    string [] public party = ["APC", "PDP", "LP", "NNPP"];

    struct candidate {
        string name;
        address addr;
        string party;
    }


    /**
     * @dev Store value in variable
     * @param name value for candidate name
     * @param candAddress value for candidate Address
     * @param partyNum value for candidate party
     */
    function createCandidate(string memory name, address candAddress, uint256 partyNum) public {
        candidate memory NewCandidate;
        NewCandidate.name = name;
        NewCandidate.addr = candAddress;
        NewCandidate.party = party[partyNum];        
    }

    /**
     * @dev Return value 
     * @return value of 'number'
     */
    // function retrieve() public view returns (uint256){
    //     return number;
    // }
}

